const Style = (
  <style>
    {`
      body,
      h1,
      h2,
      h3,
      div,
      p {
        margin: 0;
        padding: 0;
      }

      body {
        background-color: gray;
      }

      .arrow {
        width: 30px;
        height: 30px;
        border: 5px solid;
        border-color: #565656 #565656 transparent transparent;
        transform: rotate(45deg);
      }
    `}
  </style>
);

export default Style;
